    return (

      <div >
         <picture>
      <source media="(min-width: 1024px)" src="reactt-light_1200x628_Desktop.png"/>
      <source media="(max-width: 768px)" src="reactt-light_1200x628_Mobile.png"/>
      <source media="(min-width: 768px) and (max-width: 1024px)" src="reactt-light_1200x628_Tab.png"/>
      <img src="reactt-light_1200x628.png" alt="" styleName='brain-image'/>
 </picture>
      {/* <img class="d-none d-sm-block img fluid w-50" src="/public/css/reactt-light_1200x628.png"> */}
      </div>
      
           )
  }
  
  export default Footer
